import React, { Component } from 'react'
import BigBtcChart from './BigBtcChart'

class ChartList extends Component {
    constructor(){
        super()
        this.state = {
            charts: []
        }
    }
    render(){
        return(
            <div>
                <BigBtcChart />
            </div>
        )
    }
}

export default ChartList
